import React from 'react'
import './../../Style/events/NextEvent.css';
import { useNavigate } from 'react-router-dom';
function PastEvents({eventName, url, image,id2}) {
  const navigate = useNavigate();
  return (
    <>
            <div 
              className='PastEventPoster'
            >
                <h1>{eventName}</h1>
                {!image && <div class="colorOverlay pastOverlay"></div> }
                {image &&<img 
                  src={image}
                  style={{
                    position:"absolute",
                    top:"0",
                    left:"0",
                    width:"100%",
                    height:"100%",
                    borderRadius:"5px",
                    borderColor:"transparent !important",
                    zIndex:"1"
                  }}
                  alt="Description of the image"
                ></img>}
            </div>
            <br/>
        <div style={{display:"block"}}
        className='thumbnailLinks' 
        onClick={() => {
          navigate(`/event?id=${id2}`);
                      }
                }
                >
                    <a target="_blank">Read More</a>
          </div>
    </>
  )
}

export default PastEvents
